body:
배멀미가 있거나 어린유아들은 낚시체험 하기어려웠는데 만족스럽게 체험했어요! 실내라 비올때 가기도 좋고 여러가지 어린이체험할께 있어서 아이는 즐거운 시간 보냈네요 ^^ 물에젖을수있으니 예방용으로 아이들 여벌옷,여벌양말,속옷 미리챙겨가셔요. 

**시설이 낙후된 느낌, 직원분이 한분만 계셔서 뭐 물어보기 굉장히 난감,장화/장갑 청결관리가 잘되는지 좀 의심^^;
*** 어른은 마음이 불편했으나, 아이는 굉장히 즐거워했음

사려니숲길인줄알고갔는데 다른 곳이네요
여기도 좋긴좋았어요!
여기보고 3분거리에 사려니숲길로다시갔네요;

오랜만에 다시 찾은 한의원입니다!
찾는 환자분들이 많아서 예약은 필수라고 하더군요! 예약을 안하고 간 저는 오래 기다리게 되었습니다.^^;

예전처럼 원장님은 친절하시고 치료도 성심성의껏 잘 봐주셨습니다. 다한증치료도 잘 하신다고 하여약상담도 받았습니다. 약처방 전 테스트도 꼼꼼히해주셔서 좋았습니다.

오랜만에 불부항을 받으니 몸이 피로가 많이 풀리는 느낌입니다. 피부가 아플 수 있지만 꾸준히 받으면 효과가 크다고 하니 앞으로 꾸준히 받으려고 하고 있습니다.

예전에도 이곳을 찾아서 스트레스성 피로를 잘 치료해주셔서 몸이 많이 좋아졌었는데 몸  상태가 좋아졌다고 그 동안 조금 관리를 안했었네요.^^;

앞으로는 교만하지 않고 꾸준히 나오려고 생각하고 있습니다. 다짐의 차원에서 리뷰를 남깁니다!

어향가지는 생각보다 괜찮고
버거는 쏘쏘~ 궂이 안찾아가서 먹어도되요~
화장실 청결은 ㅠㅠ 놀랬습니다;;;
